import React, { useState } from 'react';
import axios from 'axios';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [type, setType] = useState('1vs1');
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');
  const [imageUrl, setImageUrl] = useState('');
  const [successMessage, setSuccessMessage] = useState('');
  const [errorMessage, setErrorMessage] = useState('');

  const handleHostTournament = async () => {
    if (!title || !description || !startTime || !endTime) {
      setErrorMessage('Please fill out all fields.');
      return;
    }

    try {
      const response = await axios.post('http://localhost:5000/tournament/host', {
        title,
        description,
        type,
        startTime,
        endTime,
        imageUrl,
      });

      setSuccessMessage(response.data.message);
      setErrorMessage('');
      setTitle('');
      setDescription('');
      setType('1vs1');
      setStartTime('');
      setEndTime('');
      setImageUrl('');
    } catch (error) {
      console.error('Error hosting tournament:', error.message);
      setErrorMessage('Failed to host tournament.');
    }
  };

  return (
    <div className="admin-dashboard-container">
      <h2>Host a Tournament</h2>
      <div className="form-group">
        <label>Title</label>
        <input
          type="text"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          placeholder="Tournament Title"
        />
      </div>
      <div className="form-group">
        <label>Description</label>
        <textarea
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          placeholder="Tournament Description"
        ></textarea>
      </div>
      <div className="form-group">
        <label>Type</label>
        <select value={type} onChange={(e) => setType(e.target.value)}>
          <option value="1vs1">1vs1</option>
          <option value="2vs2">2vs2</option>
          <option value="3vs3">3vs3</option>
          <option value="4vs4">4vs4</option>
        </select>
      </div>
      <div className="form-group">
        <label>Start Time</label>
        <input
          type="datetime-local"
          value={startTime}
          onChange={(e) => setStartTime(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>End Time</label>
        <input
          type="datetime-local"
          value={endTime}
          onChange={(e) => setEndTime(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Image URL</label>
        <input
          type="text"
          value={imageUrl}
          onChange={(e) => setImageUrl(e.target.value)}
          placeholder="Optional: Image URL"
        />
      </div>
      <button onClick={handleHostTournament}>Host Tournament</button>
      {successMessage && <p className="success-message">{successMessage}</p>}
      {errorMessage && <p className="error-message">{errorMessage}</p>}
    </div>
  );
};

export default AdminDashboard;
